class Solution:
    """
    @see https://leetcode.com/problems/minimum-window-substring/
    """
    # @param {string} s
    # @param {string} t
    # @return {string}
    def minWindow(self, s, t):
        idx = [] 
        counter = {}
        matches = len(t)
        slen = len(s)
        sub = ""
        minidx = 0
        maxidx = 0
        for c in t:
            if c not in counter:
                counter[c] = 1
            else:
                counter[c] += 1

        for i,c in enumerate(s):
            if c in counter:
                idx.append((i,c))
                counter[c] -= 1
                if counter[c] >= 0:
                    matches -= 1
                if matches == 0:
                    while True:
                        if counter[idx[0][1]] < 0:
                            counter[idx[0][1]] += 1
                            idx.pop(0)
                        else:
                            break
                    if idx[-1][0] - idx[0][0] < slen:
                        slen = idx[-1][0] - idx[0][0]
                        sub = s[idx[0][0]:idx[-1][0]+1]
        return sub

if __name__ == "__main__":
    solution = Solution()
    print(solution.minWindow("ADOBECODEBANC", "ABC"))
    print(solution.minWindow("", ""))

